import React, { Component } from "react";
import Graph from "./Graph.js";

class UserGraph extends Component {
  render() {
    const data = [
      {
        name: "0",
        uv: 1000,
        amt: 2400
      },
      {
        name: "5",
        uv: 1200,
        amt: 2210
      },
      {
        name: "10",
        uv: 1320,
        amt: 2290
      },
      {
        name: "15",
        uv: 1236,
        amt: 2000
      },
      {
        name: "20",
        uv: 800,
        amt: 2181
      },
      {
        name: "25",
        uv: 900,
        amt: 2500
      },
      {
        name: "30",
        uv: 1000,
        amt: 2100
      }
    ];
    return (
      <div>
        <Graph title="New Users Last 30 Days" data={data} />
      </div>
    );
  }
}

export default UserGraph;
